We follow the rules of priority, so we start with the innermost expressions. I will use {} to mark the expressions we have already worked with:

First Step: 
Lots of operators have two digits only, those results are easy to compute:

MAX [MAX [MAX {MIN [MAX 9 3] [MIN 12 2]}] [SM {MIN 9 9} {SM 10 1}]]
{MAX {MAX 7 12 [MAX 18 11]} {MIN {MAX 9 9} {SM 7 10}}}

Second Step: 
Min, Sum and Max of identical two digits:

{MAX {MAX {MIN 9 2}} {SM 9 {SM 1 2}} 
{MIN {MAX {MAX 9 {MAX 7 13}} {MAX 9 8}}} 
MAX {SM {MAX {MIN 5 1}} {MAX 6 1}} {MIN {MAX 8 10} {MIN 6 {MIN 2 6}}}}

Third Step: 
Min and Sum of two digits AND Min of a number and a undetermined expression:

{MAX {MAX 2 10} {MIN 9 {SM 2 2}}} 
{MIN {MAX {MAX 9 13} 8} MAX {SM {MAX 5 1} 6} {MIN 10 6}}

Fourth Step: 

Working with brackets, from innermost to outermost

{MAX {MAX 2 10} 4} {MIN {MAX {MAX 9 13} 8} MAX 6 10}
{MAX 10 4} {MIN {MAX 13 8} 10}
{10 4} {MIN 13 10}
10 10

Fifth Step:
Sum Modulo 10 of different numbers

10
Final result:10
